import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import Strategy from "../assets/images/strategy.png";
import Creative from "../assets/images/creative.png";
import Technology from "../assets/images/technology.png";
import Marketing from "../assets/images/marketing.png";

export default function Whatwedo() {
  return (
    <section className="what-we-do my-5">
      <Container>
        <Row className="gx-lg-5">
          {whatWeDoContents.map((content, i) => (
            <Col md={3} className="mt-4 mt-lg-0" key={i}>
              <Card className="border-0">
                <Card.Header className="border-0 p-0 bg-white">
                  <img
                    src={content.image}
                    alt={content.title}
                    className="img-fluid"
                  />
                </Card.Header>
                <Card.Body className="px-0">
                  <Card.Text>
                    <p className="description">{content.description}</p>
                  </Card.Text>
                  <Card.Link className="align-items-center">
                    <a href={content.link}>
                      <svg
                        xmlns="http://www.w3.org/2000/svg"
                        width="16"
                        height="16"
                        fill="currentColor"
                        class="bi bi-arrow-up-right"
                        viewBox="0 0 16 16"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M14 2.5a.5.5 0 0 0-.5-.5h-6a.5.5 0 0 0 0 1h4.793L2.146 13.146a.5.5 0 0 0 .708.708L13 3.707V8.5a.5.5 0 0 0 1 0v-6z"
                        />
                      </svg>
                      <span className="ms-1">read more...</span>
                    </a>
                  </Card.Link>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>
    </section>
  );
}

const whatWeDoContents = [
  {
    image: Strategy,
    title: "Strategy",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Creative,
    title: "Creative",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Technology,
    title: "Technology",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Marketing,
    title: "Marketing",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
];
